//npm start
import React from 'react';
import avatar from '../../../images/avatar.jpg';
import PostCss from './Post.module.css';

const Post = () => {
    return (
        <React.Fragment>
                <article>
                    <img src={avatar} alt="Аватар" />
                    <p>My Post</p>
                </article>
        </React.Fragment>
    );
}

export default Post;
